function JurnalForm() {
    return (
      <form>
        <h2>Tambah Jurnal</h2>
        <input type="date" placeholder="Tanggal" />
        <input type="text" placeholder="Kelas" />
        <input type="text" placeholder="Nama Guru" />
        <input type="text" placeholder="Subjek" />
        <input type="text" placeholder="Topik" />
        <textarea placeholder="Keterangan"></textarea>
        <button type="submit">Simpan</button>
      </form>
    );
  }
  
  export default JurnalForm;
